import React, { Component } from 'react';
import Pokecard from './Pokecard';

const firstHand = [
    <Pokecard
        id={4}
        name="Charmander987987"
        type="fire"
        base_experience={62}
      />,
      <Pokecard
        id={4}
        name="Charmander"
        type="fire"
        base_experience={62}
      />,
      <Pokecard
        id={4}
        name="Charmander"
        type="fire"
        base_experience={62}
      />
];

const boxStyle = {
    margin: '12px',
    border: '5px solid black',
    width: '150px',
    height: '250px',
    float: 'left'
};

class Pokedex extends Component {
    render() {
        return(
        <div className="boxStyle">
            {firsthand}
        </div>
        )
    }
}

export default Pokedex;
